// StudentDetails.js
import React, { useState, useEffect } from 'react';
import './StudentDetails.css';
import { useNavigate } from 'react-router-dom';

export default function StudentDetails() {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState('');
  const [formData, setFormData] = useState({
    email: '',
    studentid: '',
    firstname: '',
    lastname: '',
    gpa: '',
    major: '',
    classification: '',
  });

  useEffect(() => {
    // assume your login saved a JWT in localStorage
    const token = localStorage.getItem('access_token');
    if (!token) {
      navigate('/', { state: { openLogin: true } });
      return;
    }

    (async () => {
      try {
        const res = await fetch('/api/me', {
          headers: { Authorization: `Bearer ${token}` },
        });
        if (res.status === 401) {
          navigate('/', { state: { openLogin: true } });
          return;
        }
        if (!res.ok) throw new Error(await res.text());
        const data = await res.json();

        // Pre-fill email + studentid from DB; keep others if you want editing
        setFormData(prev => ({
          ...prev,
          email: data.email || '',
          studentid: data.studentid || '',
          firstname: data.firstname || '',
          lastname: data.lastname || '',
          gpa: data.gpa ?? '',
          major: data.major || '',
          classification: data.classification || '',
        }));
      } catch (e) {
        setErr('Could not load your profile.');
        console.error(e);
      } finally {
        setLoading(false);
      }
    })();
  }, [navigate]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(p => ({
      ...p,
      [name]: name === 'gpa' && value !== '' ? Number(value) : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    // If you update profile fields on submit:
    // await fetch('/api/profile', { method:'PUT', headers:{ 'Content-Type':'application/json', Authorization:`Bearer ${token}` }, body: JSON.stringify(formData) });
    navigate('/', { state: { openLogin: true } });
  };

  if (loading) return <div>Loading…</div>;
  if (err) return <div className="error">{err}</div>;

  return (
    <div className="student-details-wrapper">
      <div className="student-details-container">
        <h2>Complete Your Student Profile</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Email:</label>
            {/* readOnly so it’s included if you serialize; keeps it non-editable */}
            <input type="email" name="email" value={formData.email} readOnly />
          </div>

          <div className="form-group">
            <label>Student ID:</label>
            <input type="text" name="studentid" value={formData.studentid} readOnly />
          </div>

          <div className="form-group">
            <label>First name:</label>
            <input type="text" name="firstname" value={formData.firstname} onChange={handleChange} required />
          </div>

          <div className="form-group">
            <label>Last name:</label>
            <input type="text" name="lastname" value={formData.lastname} onChange={handleChange} required />
          </div>

          <div className="form-group">
            <label>GPA:</label>
            <input type="number" name="gpa" value={formData.gpa} onChange={handleChange} step="0.01" min="0" max="4" required />
          </div>

          <div className="form-group">
            <label>Major:</label>
            <input type="text" name="major" value={formData.major} onChange={handleChange} required />
          </div>

          <div className="form-group">
            <label>Classification:</label>
            <input type="text" name="classification" value={formData.classification} onChange={handleChange} required />
          </div>

          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
}
